import { AfterViewInit, Component, ElementRef, OnInit } from '@angular/core';
import Docxtemplater from 'docxtemplater';
import * as PizZip from 'pizzip';
import PizZipUtils from 'pizzip/utils/index.js';

import * as wjc from '@grapecity/wijmo';
import WebViewer, { WebViewerInstance } from '@pdftron/webviewer';

import { Convert } from 'core';

@Component({
    selector: 'bravo-docxtemplater',
    templateUrl: './bravo.docxtemplater.html',
    styleUrls: ['./bravo.docxtemplater.scss']
})
export class BravoDocxtemplater extends wjc.Control implements OnInit, AfterViewInit {
    constructor(private elRef: ElementRef) {
        super(elRef.nativeElement);
    }

    ngOnInit(): void {}

    private _dataBase64: string =
        '';
    private _typeBlob: string = 'data:application/vnd.openxmlformats-officedocument.wordprocessingml.document';
    private _dataBlob: Blob = new Blob([new Uint8Array(Convert.fromBase64String(this._dataBase64))], {
        type: this._typeBlob
    });

    ngAfterViewInit(): void {
        this.onPreview(this._dataBlob);
    }

    private _file!: Blob;
    private loadFile(url, callback) {
        PizZipUtils.getBinaryContent(url, callback);
    }

    public onGenerate() {
        this.loadFile(this._typeBlob + ';base64,' + this._dataBase64, (error: Error | null, content: string) => {
            if (error) {
                throw error;
            }
            const zip = new PizZip(content);
            const doc = new Docxtemplater(zip, {
                paragraphLoop: true,
                linebreaks: true
            });

            doc.setData({
                company: 'Cổ phần Phần mềm Bravo',
                full_name: 'Lê Anh Đức',
                name: 'Đức',
                signature: 'Duc',
                date_of_birth: '27/02/2001',
                cmnd: Math.floor(Math.random() * Date.now()),
                date_range: `${Math.floor(Math.random() * 31)}/${Math.floor(Math.random() * 13)}/2020`,
                phone: '0977.977.655',
                city: 'Hà Nội',
                residential_address: 'Kim Nỗ, Đông Anh, Hà Nội',
                day: 28,
                month: 10,
                year: 2022
            });
            try {
                // render the document (replace all occurences of {first_name} by John, {last_name} by Doe, ...)
                doc.render();
            } catch (error) {
                // The error thrown here contains additional information when logged with JSON.stringify (it contains a properties object containing all suberrors).
                function replaceErrors(key, value) {
                    if (value instanceof Error) {
                        return Object.getOwnPropertyNames(value).reduce(function (error, key) {
                            error[key] = value[key];
                            return error;
                        }, {});
                    }
                    return value;
                }
                console.log(JSON.stringify({ error: error }, replaceErrors));

                if (error.properties && error.properties.errors instanceof Array) {
                    const errorMessages = error.properties.errors
                        .map(function (error) {
                            return error.properties.explanation;
                        })
                        .join('\n');
                    console.log('errorMessages', errorMessages);
                    // errorMessages is a humanly readable message looking like this :
                    // 'The tag beginning with "foobar" is unopened'
                }
                throw error;
            }
            this._file = doc.getZip().generate({
                type: 'blob',
                mimeType: 'application/vnd.openxmlformats-officedocument.wordprocessingml.document'
            });

            this.onPreview(this._file);
        });
    }

    private _webViewer!: WebViewerInstance;
    public onPreview(pFile?: any) {
        if (!this._webViewer)
            WebViewer(
                {
                    path: '../../../library/webviewer',
                    licenseKey: 'Insert license key here'
                },
                this.hostElement.querySelector('.preview')
            ).then((instance: WebViewerInstance) => {
                instance.UI.loadDocument(pFile, { filename: 'bravo.docx' });
                instance.UI.setTheme('light');
                instance.UI.setLanguage(instance.UI.Languages.VI);
                instance.UI.disableElements(['header', 'toolsHeader']);
                instance.UI.setZoomLevel(150);
                this._webViewer = instance;
                /**
                 * Download
                 */
                this.hostElement.querySelector('.download').addEventListener('click', async () => {
                    await instance.UI.downloadPdf();
                });

                /**
                 * Print
                 */
                this.hostElement.querySelector('.print').addEventListener('click', () => {
                    instance.UI.setPrintQuality(5);
                    instance.UI.useEmbeddedPrint(true);
                    /**
                     * @skip printModal
                     */
                    instance.UI.disableElements(['printModal']);
                    instance.UI.printInBackground({
                        isPrintCurrentView: false
                    });
                    instance.UI.print();
                });
            });
        else {
            this._webViewer.UI.loadDocument(pFile, { filename: 'bravo.docx' });
        }
    }

    onPrint(_file: Blob = this._file) {
        const { documentViewer, annotationManager } = this._webViewer.Core;
    }
}
